    const apiKey = "ebc637be5b4264945558e43088a33d06";
    const apiUrl = "https://api.countrylayer.com/v2/all?access_key =" + apiKey;

    const callApi = async () => {
        const res = await axios.get(apiUrl);
        console.log(res.data)
    }

    useEffect(() => {
        callApi();
    }, []);

    return (

        <section className="millionärQuiz">
            <div> Errate das Land innerhalb 5 Versuchen</div>
        </section>
    )
}
export default CountryQuiz;
